from itertools import combinations, tee

def pairwise(it):
    a, b = tee(it)
    next(b)
    return zip(a, b)

class Team:
    def __init__(self, victories=0, defeats=0, draws=0):
        self.victories = victories
        self.defeats = defeats
        self.draws = draws

    def score(self):
        return self.victories * 3 + self.draws

    def to_key(self):
        return f'{self.victories}{self.draws}{self.defeats}'

def right_order(team_a, team_b):
    score_a, score_b = team_a.score(), team_b.score()
    return score_a > score_b or (score_a == score_b and \
            team_a.victories >= team_b.victories)

