def compute_outcomes(teams, games, i):
    if i == len(games):
        for a, b in pairwise(teams):
            if not right_order(a, b):
                return
        key = tuple(x.to_key() for x in teams)
        outcomes.setdefault(key, 0)
        outcomes[key] += 1
        return
    team_a, team_b = games[i]
    # team_a wins
    teams[team_a].victories += 1
    teams[team_b].defeats += 1
    compute_outcomes(teams, games, i + 1)
    teams[team_a].victories -= 1
    teams[team_b].defeats -= 1
    # team_b wins
    teams[team_a].defeats += 1
    teams[team_b].victories += 1
    compute_outcomes(teams, games, i + 1)
    teams[team_a].defeats -= 1
    teams[team_b].victories -= 1
    # draw
    teams[team_a].draws += 1
    teams[team_b].draws += 1
    compute_outcomes(teams, games, i + 1)
    teams[team_a].draws -= 1
    teams[team_b].draws -= 1

def compute_lookup():
    for num_teams in range(2, 5):
        games = list(combinations(range(num_teams), 2)) * 2
        compute_outcomes([Team() for _ in range(num_teams)], games, 0)
    uniques = set(x for x, y in outcomes.items() if y == 1)
    not_unique = set(outcomes) - uniques
    print('uniques =', [''.join(x) for x in uniques])
    print('not_unique =', [''.join(x) for x in not_unique])

def solve():
    compute_lookup()
    t = int(input())
    for _ in range(t):
        n = int(input())
        outcome = tuple(input().strip() for _ in range(n))
        if outcome in uniques:
            print("Unique")
        elif outcome in not_unique:
            print("Not unique")
        else:
            print("Invalid")

if __name__ == '__main__':
    solve()
